import React from 'react';
import { 
    AppBar, 
    Toolbar, 
    Typography, 
    Button, 
    Box,
    IconButton,
    useTheme,
    useMediaQuery
} from '@mui/material';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import DashboardIcon from '@mui/icons-material/Dashboard';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import TaskIcon from '@mui/icons-material/Task';
import LogoutIcon from '@mui/icons-material/Logout';
import LoginIcon from '@mui/icons-material/Login';
import PersonAddIcon from '@mui/icons-material/PersonAdd';

function Navbar() {
    const navigate = useNavigate();
    const location = useLocation();
    const { isAuthenticated, logout } = useAuth();
    const theme = useTheme();
    const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

    const handleLogout = () => {
        logout();
        navigate('/login');
    };

    const isActive = (path) => {
        return location.pathname === path;
    };

    const navButton = {
        mx: 1,
        px: 2,
        borderRadius: '12px',
        transition: 'all 0.2s ease-in-out',
        '&:hover': {
            background: 'rgba(220, 20, 60, 0.1)',
            transform: 'translateY(-2px)',
        },
        '&.active': {
            background: 'rgba(220, 20, 60, 0.2)',
            color: '#DC143C',
        }
    };

    return (
        <AppBar 
            position="sticky" 
            elevation={0}
            sx={{
                background: 'rgba(10, 10, 15, 0.8)',
                backdropFilter: 'blur(20px)',
                borderBottom: '1px solid rgba(220, 20, 60, 0.1)',
            }}
        >
            <Toolbar sx={{ justifyContent: 'space-between' }}>
                <Typography 
                    variant="h5" 
                    component="div" 
                    sx={{ 
                        cursor: 'pointer',
                        fontWeight: 700,
                        background: 'linear-gradient(45deg, #FFFFFF, #DC143C)',
                        WebkitBackgroundClip: 'text',
                        WebkitTextFillColor: 'transparent',
                        letterSpacing: '-0.02em',
                        transition: 'all 0.3s ease',
                        '&:hover': {
                            transform: 'scale(1.05)',
                        }
                    }}
                    onClick={() => navigate('/')}
                >
                    Tempo
                </Typography>

                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                    {isAuthenticated ? (
                        <>
                            {!isMobile && (
                                <>
                                    <Button 
                                        color="inherit" 
                                        startIcon={<DashboardIcon />}
                                        onClick={() => navigate('/dashboard')}
                                        sx={{
                                            ...navButton,
                                            ...(isActive('/dashboard') && {
                                                background: 'rgba(220, 20, 60, 0.2)',
                                                color: '#DC143C',
                                            })
                                        }}
                                    >
                                        Dashboard
                                    </Button>
                                    <Button 
                                        color="inherit" 
                                        startIcon={<CalendarMonthIcon />}
                                        onClick={() => navigate('/calendar')}
                                        sx={{
                                            ...navButton,
                                            ...(isActive('/calendar') && {
                                                background: 'rgba(220, 20, 60, 0.2)',
                                                color: '#DC143C',
                                            })
                                        }}
                                    >
                                        Calendar
                                    </Button>
                                    <Button 
                                        color="inherit" 
                                        startIcon={<TaskIcon />}
                                        onClick={() => navigate('/tasks')}
                                        sx={{
                                            ...navButton,
                                            ...(isActive('/tasks') && {
                                                background: 'rgba(220, 20, 60, 0.2)',
                                                color: '#DC143C',
                                            })
                                        }}
                                    >
                                        Tasks
                                    </Button>
                                </>
                            )}
                            <IconButton
                                color="inherit"
                                onClick={handleLogout}
                                sx={{
                                    ml: 2,
                                    background: 'rgba(220, 20, 60, 0.1)',
                                    '&:hover': {
                                        background: 'rgba(220, 20, 60, 0.2)',
                                        color: '#DC143C',
                                    }
                                }}
                            >
                                <LogoutIcon />
                            </IconButton>
                        </>
                    ) : (
                        <>
                            <Button 
                                color="inherit" 
                                startIcon={!isMobile && <LoginIcon />}
                                onClick={() => navigate('/login')}
                                sx={navButton}
                            >
                                {isMobile ? <LoginIcon /> : 'Login'}
                            </Button>
                            <Button 
                                variant="contained"
                                startIcon={!isMobile && <PersonAddIcon />}
                                onClick={() => navigate('/register')}
                                sx={{
                                    ml: 1,
                                    background: 'linear-gradient(45deg, #DC143C, #FF4D6A)',
                                    boxShadow: '0 4px 14px 0 rgba(220, 20, 60, 0.39)',
                                    '&:hover': {
                                        background: 'linear-gradient(45deg, #FF4D6A, #DC143C)',
                                        boxShadow: '0 6px 20px rgba(220, 20, 60, 0.5)',
                                        transform: 'translateY(-2px)',
                                    }
                                }}
                            >
                                {isMobile ? <PersonAddIcon /> : 'Sign Up'}
                            </Button>
                        </>
                    )}
                </Box>
            </Toolbar>
        </AppBar>
    );
}

export default Navbar;
